import { Texture, Scene, Nullable } from "babylonjs";

// mike_gitter02.png
const dataurl = "data:image/png;base64,";
export default dataurl;

type onLoadCallback = Nullable<() => void>;
type onErrorCallback = Nullable<(message?: string, exception?: any) => void>;

export function toTexture(
   scene: Scene, 
   noMimmap?: boolean, invertY?: boolean, 
   samplingMode?: number, 
   onLoad?: onLoadCallback, onError?: onErrorCallback, 
   buffer?: any, deleteBuffer?: boolean, format?: number) {

   return new Texture(dataurl, scene, noMimmap, invertY, samplingMode, onLoad, onError, buffer, deleteBuffer, format)
   
}